export default function MenuLink({ product, href, ref }) {
  console.log(product);
  return (
    <MenuLinkStyles href='#'>
      <a
        href={{
          pathname: '/products/[products]',
          query: { products: `${itemsByIndex(index).title}` },
        }}
        ref={ref}
      >
        {product.title}
      </a>
    </MenuLinkStyles>
  );
}
